import React from 'react';
import logo from './butterfly.png';
import './Logo.styles.scss';
const Logo = () =>{
    return (
        <div className = 'logo'>
        <img src = {logo} className = 'logo-graphic'/>
        <h1 style = {{display:'flex', flexDirection:'column', margin:'2px 0 2px 0'}}>
        <span >Callie Babilot</span> 
        <span style={{fontFamily:'Apple Chancery, cursive'}}>Graphic Designer</span> 
        </h1>
        </div>
    )
}

export default Logo
